import React from 'react'

const Navbar = ({name, setAuthentication}) => {
    const logout = (e) => {
        e.preventDefault();
        setAuthentication(false);
    }
    console.log("Passed")
    console.log(name)
    return (
        <div>
            <h1>{name}</h1>
            <button onClick={logout}> Logout </button>
        </div>
    )
}

export default Navbar
